import React from "react";

function TextContent({ content, additionalClasses = '' }) {
    return (
      <p className={`flex-1 shrink self-start basis-0 max-md:max-w-full ${additionalClasses}`}>
        {content}
      </p>
    );
}

function ImagePlaceholder() {
    return (
      <div className="flex flex-1 shrink bg-fuchsia-100 basis-0 h-[252px] min-w-[240px] w-[454px]" />
    );
}

function AboutMe() {
    const paragraphs = [
      "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. when an unknown printer took a galley of type and scrambled it to make a type specimen book Outside of work you can find me drawing or painting, cooking, on a hike, at the tennis court, or playing the NYT crossword archives.",
      "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. when an unknown printer took a galley of type and scrambled it to make a type specimen book Outside of work you can find me drawing or painting, cooking, on a hike, at the tennis court, or playing the NYT crossword archives."
    ];

    return (
        <div className="flex overflow-hidden flex-col">
            <section className="flex flex-col justify-center w-full max-md:max-w-full">
            <article className="flex flex-col justify-center w-full text-black max-md:max-w-full">
                <h1 className="text-2xl font-semibold leading-none max-md:max-w-full">
                # about_me
                </h1>
                <div className="flex flex-wrap gap-10 mt-10 w-full text-base max-md:max-w-full">
                <TextContent content={paragraphs[0]} />
                <ImagePlaceholder />
                </div>
            </article>
            <TextContent content={paragraphs[1]} additionalClasses="mt-10 text-lg leading-6" />
            </section>
        </div>
    );
}

export default AboutMe;
